import{_ as t,a as o,b as n,c as i,d as s}from"./chunks/hovergames_colored_small.B7z1rbKS.js";import{_ as l,c as p,j as r,a as d,G as c,a8 as u,B as h,o as m}from"./chunks/framework.BDnHobkS.js";const y=JSON.parse('{"title":"NXP RDDRONE-FMUK66 FMU (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"en/flight_controller/nxp_rddrone_fmuk66.md","filePath":"en/flight_controller/nxp_rddrone_fmuk66.md"}'),f={name:"en/flight_controller/nxp_rddrone_fmuk66.md"};function g(b,e,k,w,D,v){const a=h("Badge");return m(),p("div",null,[e[0]||(e[0]=r("h1",{id:"nxp-rddrone-fmuk66-fmu-discontinued",tabindex:"-1"},[d("NXP RDDRONE-FMUK66 FMU (Discontinued) "),r("a",{class:"header-anchor",href:"#nxp-rddrone-fmuk66-fmu-discontinued","aria-label":'Permalink to "NXP RDDRONE-FMUK66 FMU (Discontinued)"'},"​")],-1)),c(a,{type:"info",text:"Discontinued"}),e[1]||(e[1]=u('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This flight controller has been <a href="./../flight_controller/autopilot_experimental.html">discontinued</a> and is no longer commercially available.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://www.nxp.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>RDDRONE-FMUK66 FMU is a reference design using NXP Semiconductor components that closely follows Pixhawk FMUv4 specifications while adding two wire automotive Ethernet 100BASET1 and secure element A71CH (RevC) or SE050 (RevD). NXP provides the schematics, gerbers, BOM and source files so that anyone can duplicate, change or repurpose this design.</p><p>This is the official FMU for use with <a href="https://www.hovergames.com/" target="_blank" rel="noreferrer">HoverGames</a>.</p><p><img src="'+t+'" alt="RDDRONE-FMUK66 FMU Hero Image1"></p><p><img src="'+o+'" alt="RDDRONE-FMUK66 FMU Hero Image2"></p><p>The NXP FMU and included peripherals have been tested to comply with FCC/CE/RoHs/REACH directives.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>These flight controllers are <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="quick-summary" tabindex="-1">Quick Summary <a class="header-anchor" href="#quick-summary" aria-label="Permalink to &quot;Quick Summary&quot;">​</a></h2><ul><li><strong>Main FMU Processor:</strong><ul><li>Kinetis K66 MK66FN2MOVLQ18 microcontroller running at 180MHz Cortex-M4F MCU, 2MB Flash, 256KB SRAM, Dual USBs (FS + HS), Ethernet, 144-LQFP.</li></ul></li><li><strong>On-board sensors:</strong><ul><li>Accel/Gyro: BMI088/ICM42688 (RevD)...</li><li>Accel/Magnetometer: FXOS8700CQ</li><li>Gyro: FXAS21002CQ</li><li>Magnetometer: BMM150</li><li>Barometer: ML3115A2</li><li>Barometer: BMP280</li></ul></li><li><strong>GPS:</strong><ul><li>u-blox Neo-M8N GPS/GLONASS receiver; integrated magnetometer IST8310</li></ul></li></ul><p>This FMU is provided only as a kit, and includes <a href="https://www.segger.com/products/debug-probes/j-link/models/j-link-edu-mini/" target="_blank" rel="noreferrer">Segger Jlink EDU mini debugger</a>, DCD-LZ debugger adapter, USB-TTL-3V3 console cable, HolyBro GPS module, battery power module, SDCard and case, screws and stickers. Telemetry radios (<a href="https://www.nxp.com/part/HGD-TELEM433" target="_blank" rel="noreferrer">HGD-TELEM433</a> and <a href="https://www.nxp.com/part/HGD-TELEM915" target="_blank" rel="noreferrer">HGD-TELEM915</a>) must be purchased separately to match ISM band frequencies used in your country.</p><p><img src="'+n+'" alt="RDDRONE-FMUK66 FMU Kit"></p><p>A &quot;Lite&quot; version RDDRONE-FMUK66L is also available which does not include the power module, GPS, Jlink or USB-TTL-3V3 console cable or SDCard.<a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66#buy" target="_blank" rel="noreferrer">Scroll down to see FMUK66L in the buy section of the FMUK66 buy page</a></p><p>Additional information can be found in the <a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66" target="_blank" rel="noreferrer">Technical Data Sheet</a>. </p><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p><strong>RDDRONE-FMUK66</strong> reference design kit may be purchased direct from NXP or from any of NXP&#39;s authorised worldwide network of <a href="https://www.nxp.com/support/sample-and-buy/distributor-network:DISTRIBUTORS" target="_blank" rel="noreferrer">electronics distributors</a>.</p><ul><li><a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66#buy" target="_blank" rel="noreferrer">Purchase Link</a> (www.nxp.com)</li><li>Telemetry radios are purchased separately depending on frequency band: <ul><li><a href="https://www.nxp.com/part/HGD-TELEM433" target="_blank" rel="noreferrer">HGD-TELEM433</a></li><li><a href="https://www.nxp.com/part/HGD-TELEM915" target="_blank" rel="noreferrer">HGD-TELEM915</a></li></ul></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p><em>RDDRONE-FMUK66</em> FMU is also included in the complete HoverGames drone kit: <a href="https://www.nxp.com/applications/solutions/industrial/aerospace-and-mobile-robotics/uavs-drones-and-rovers/nxp-hovergames-drone-kit-including-rddrone-fmuk66-and-peripherals:KIT-HGDRONEK66#buy" target="_blank" rel="noreferrer">KIT-HGDRONEK66</a></p></div><h2 id="assembly-setup" tabindex="-1">Assembly/Setup <a class="header-anchor" href="#assembly-setup" aria-label="Permalink to &quot;Assembly/Setup&quot;">​</a></h2><p><a href="https://nxp.gitbook.io/hovergames" target="_blank" rel="noreferrer">https://nxp.gitbook.io/hovergames</a></p><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make nxp_fmuk66-v3_default</span></span></code></pre></div><h2 id="debug-port" tabindex="-1">Debug Port <a class="header-anchor" href="#debug-port" aria-label="Permalink to &quot;Debug Port&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and the <a href="./../debug/swd_debug.html">SWD interface</a> run on the <a href="https://nxp.gitbook.io/hovergames/rddrone-fmuk66/connectors/debug-interface-dcd-lz" target="_blank" rel="noreferrer">DCD-LZ FMU Debug</a> port.</p><p>NXP&#39;s DCD-LZ is a 7 pin JST-GH connector and adds the nRST/MCU_RESET pin to the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk 6-Pin standard debug port</a>.</p><p>The DCD-LZ breakout adapter permits the use of a standard 10 pin JTAG/SWD interface (i.e. using the Segger Jlink) and a standard 5 pin FTDI USB-TTL-3V3 type cable.</p><h2 id="supported-platforms-airframes" tabindex="-1">Supported Platforms / Airframes <a class="header-anchor" href="#supported-platforms-airframes" aria-label="Permalink to &quot;Supported Platforms / Airframes&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><p><img src="'+i+'" alt="HoverGames Drone Kit"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The NXP <a href="https://www.nxp.com/kit-hgdronek66" target="_blank" rel="noreferrer">HoverGames Drone Kit</a> (shown above) is a complete drone development kit that includes everything needed to build a quadcopter. You only need to supply the 3S/4S LiPo battery.</p></div><h2 id="further-info" tabindex="-1">Further info <a class="header-anchor" href="#further-info" aria-label="Permalink to &quot;Further info&quot;">​</a></h2><ul><li><p><a href="https://nxp.gitbook.io/hovergames" target="_blank" rel="noreferrer">HoverGames online documentation</a> PX4 user and programming guide, specific assembly, construction, debugging, programming instructions.</p></li><li><p>3DModels supporting HoverGames and RDDRONE-FMUK66 can be found on <em>Thingiverse</em> at these search links: <a href="https://www.thingiverse.com/search?q=fmuk66&amp;type=things&amp;sort=relevant" target="_blank" rel="noreferrer">fmuk66</a>, <a href="https://www.thingiverse.com/search?q=hovergames&amp;type=things&amp;sort=relevant" target="_blank" rel="noreferrer">hovergames</a>.</p></li></ul><p><img src="'+s+'" alt="HoverGamesDronelogo"></p>',35))])}const x=l(f,[["render",g]]);export{y as __pageData,x as default};
